  false,\n\t\"url\": null,\n\t\"notes\": \"This digital elevation model (DEM) is a
  part of a series of DEMs produced for the National Oceanic and Atmospheric Administration
  Office for Coastal Management's Sea Level Rise and Coastal Flooding Impacts Viewer.
  The DEM includes best available lidar data known to exist at the time of DEM creation
  that meets project specifications for those counties in the state of Washington
  that fall within the boundary of the Portland, OR Weather Forecast Office (WFO),
  as defined by the NOAA National Weather Service. The DEM is derived from multiple
  LiDAR datasets collected between 2002 and 2010 for NOAA, the United States Army
  Corps of Engineers (USACE) and the United States Geological Survey (USGS). The extent
  of the DEM includes portions of Pacific, Wahkiakum, Cowlitz, Clark and Skamania
  counties. Hydrographic breaklines used in the creation of the DEM were either delineated
  using LiDAR intensity imagery or obtained from USACE. The DEMs are hydro flattened
  such that water elevations are less than or equal to 0 meters. The DEM is referenced
  vertically to the North American Vertical Datum of 1988 (NAVD88) with vertical units
  of meters and horizontally to the North American Datum of 1983 (NAD83). The resolution
  of the DEM is approximately 5 meters.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
